n_qubits = 150

# Convert to stim PauliString
pauli_strings = []
for s in stabilizers:
    ps = stim.PauliString(s)
    pauli_strings.append(ps)

print(f"Number of stabilizers: {len(pauli_strings)}")
print(f"Number of qubits: {n_qubits}")

# Create tableau and generate circuit
try:
    tableau = stim.Tableau.from_stabilizers(pauli_strings, allow_underconstrained=True, allow_redundant=True)
    circuit = tableau.to_circuit('elimination')
    print(f"Circuit generated with {len(circuit)} instructions")
    
    # Save the circuit
    with open(r"data\gpt5.2\agent_files\circuit_150.stim", "w") as f:
        f.write(str(circuit))
    
    print("Circuit saved to circuit_150.stim")
    print("\nCircuit preview (first 50 lines):")
    lines = str(circuit).split('\n')
    for line in lines[:50]:
        print(line)
except Exception as e:
    print(f"Error: {e}")
    import traceback
    traceback.print_exc()
